script: |
  super -f tsv -I q3438.sql | sort > q3438.out

vector: true

inputs:
  - name: q3438.sql
    data: |
      SELECT col0 FROM tab0 WHERE col2 + - col0 - col2 * - + col2 + - + 0 * col2 NOT BETWEEN + ( ( - + col2 ) ) AND - col0 AND NOT + col0 IS NULL;
  - name: tab0

outputs:
  - name: q3438.out
    data: |
      15
      87
      97
